import './HelpSupport.css';

const HelpSupport = () => {
  return (
    <div className="help-support">
      <h1>Help and Support</h1>
      <p>Need assistance? Find answers to your questions here.</p>
      {/* Add support or FAQ content */}
    </div>
  );
};

export default HelpSupport;
